import products from '../data/products.json';
import ProductCard from '../components/ProductCard';

function Catalog() {
  return (
    <div>
      <h1>ðŸ“± Catalog</h1>

      <div style={styles.grid}>
        {products.map(product => (
          <ProductCard
            key={product.id}
            product={product}
          />
        ))}
      </div>
    </div>
  );
}

const styles = {
  grid: {
    display: 'flex',
    gap: '16px',
    flexWrap: 'wrap',
  },
};

export default Catalog;
